import React, { Component } from 'react';

class Header extends Component {
    render() {
        return (
            <header>

                <div className="logo">
                    LOGO
                </div>

                <nav>
                    <ul>
                        <li>
                            <a href="#">Resume</a>
                        </li>
                        <li>
                            <a href="#">Projects</a>
                        </li>
                        <li>
                            <a href="#">Contact</a>
                        </li>
                    </ul>
                </nav>

            </header>
        );
    }
}

export default Header;
